import React from "react";
import { centeredPageStyles } from "../styles";
import pulp from "../../public/static/images/pulp.jpeg";

export const meta = {
    title: "Quien soy?",
    tags: ["Next.js"],
    layout: "page",
    publishDate: "2020-04-11",
    modifiedDate: false,
    seoDescription: "Esta es mi página de ejemplo de Samuel L. Jackson"
};

function About() {
    return (
        <div className="centered-container">
            <h1>¿Quien soy?</h1>
            <img src={pulp} className="img-centered" alt="Samuel L. Jackson" />

            <p>My money's in that office, right? If she start giving me some bullshit about it ain't there, and we got to go someplace else and get it, 
                I'm gonna shoot you in the head then and there. Then I'm gonna shoot that bitch in the kneecaps, find out where my goddamn money is. 
                She gonna tell me too. Hey, look at me when I'm talking to you, motherfucker. 
                You listen: we go in there, and that nigga Winston or anybody else is in there, you the first motherfucker to get shot. 
                You understand? </p>
            <style jsx>{centeredPageStyles}</style>
        </div>
    );
}

export default About;
